package multithread.misc;import java.util.concurrent.Callable;public class CompletableFutureExample {    public static void main(String[] args) {    }    static class CallableExample implements Callable<Integer> {        @Override        public Integer call() {            System.out.println("inside RunnableExample  impl " + Thread.currentThread().getName());            for (int i = 1; i < 100; i++) {                System.out.println(Thread.currentThread().getName() + " - " + i);            }            return 1;        }    }}